			"fields": "{{join(add(parameters.fields, 'dateRange', 'pivotValues'), ',')}}",
			"dateRange": "{{dateRangeFormat(environment.timezone, parameters.startDate, parameters.endDate)}}"
		}
	},
	"url": "{{buildRestliUrl('/adAnalytics', temp.parameters)}}",
	//"url": "https://bruno.requestcatcher.com/brunoTest/pivots=List((value%3ACOMPANY)%2C(value%3AACCOUNT)%2C(value%3ASHARE))",
