		"qs": {
			"scope": "{{join(distinct(merge(oauth.scope, ifempty(parameters.scope, emptyarray))), ',')}}",
			"client_id": "{{ifempty(parameters.clientId, if(common.clientId2, common.clientId2, common.clientId))}}",
			"redirect_uri": "{{oauth.redirectUri}}",
			"response_type": "code"
		},
		"url": "https://www.linkedin.com/oauth/v2/authorization",
		"response": {
			"temp": {
				"code": "{{query.code}}"
			}
		}
	},
	"token": {
		"url": "https://www.linkedin.com/oauth/v2/accessToken",
		"method": "POST",
		"body": {
			"code": "{{temp.code}}",
			"client_id": "{{ifempty(data.clientId, if(common.clientId2, common.clientId2, common.clientId))}}",
			"grant_type": "authorization_code",
			"redirect_uri": "{{oauth.redirectUri}}",
			"client_secret": "{{ifempty(data.clientSecret, if(common.clientSecret2, common.clientSecret2, common.clientSecret))}}"
		},
		"type": "urlencoded",
		"response": {
			"data": {
