function getMetadata(body) {
	const getName = (value) => {
		if (!value || !value.localized) {
			return false
		}
		const keys = Object.keys(value.localized)
		if (!keys || !keys.length) {
			return false
		}
		return value.localized[keys[0]]
	}
	const firstName = getName(body.firstName)
	const lastName = getName(body.lastName)
	return firstName + ' ' + lastName
}

