function parseReport(report) {
    if (typeof report !== 'object' || report === null) return undefined;
    const pivotValues = report.pivotValues ? report.pivotValues.map((pivotValue, index) => {
        return {
            urn: pivotValue,
        };
    }): undefined;

    let startDate = null;
    if (report.dateRange && report.dateRange.start) {
        const dateRangeStart = report.dateRange.start;
        startDate = iml.parseDate(
            `${dateRangeStart.year}-${dateRangeStart.month}-${dateRangeStart.day}`,
            'YYYY-M-D'
        );
    }

    let endDate = null;
    if (report.dateRange && report.dateRange.end) {
        const dateRangeEnd = report.dateRange.end;
        endDate = iml.parseDate(
            `${dateRangeEnd.year}-${dateRangeEnd.month}-${dateRangeEnd.day}`,
            'YYYY-M-D'
        );
    }

    delete report.dateRange;
    return {
        ...report,
        pivotValues,
        startDate,
        endDate,
    };
}

parseReport.test:
it('returns "undefined" if input does not pass the validation', () => {
    assert.strictEqual(parseReport('not an object'), undefined);
    assert.strictEqual(parseReport(null), undefined);
});

it('if there are "pivotValues" in the report, parses them and return array of objects { "urn": <pivotValue> } in "pivotValues" key in the output', () => {
    const input = {
