function buildRestliUrl(endpoint, parameters) {

	let url = endpoint;

	let queryParams = [];
	if (parameters) {
		queryParams = Object.entries(parameters)
			.map(([key, value]) => value ? `${key}=${encodeURIComponent(value)}` : undefined)
			.filter(i => i)
	}

	if (queryParams.length > 0) {
		url += `?${queryParams.join("&")}`;
	}

	return url;
}

