dateRangeFormat.code:
function dateRangeFormat(timezone, start, end) {

	if (!start) return;

	const [startYear, startMonth, startDate] = iml.formatDate(start, "YYYY-M-D", timezone).split("-");

    const startFormat = `start:(year:${Number(startYear)},month:${Number(startMonth)},day:${Number(startDate)})`;

    if(end) {
		const [endYear, endMonth, endDate] = iml.formatDate(end, "YYYY-M-D", timezone).split("-");

        const endFormat = `end:(year:${Number(endYear)},month:${Number(endMonth)},day:${Number(endDate)})`;

        return `(${startFormat},${endFormat})`;
    }

    return `(${startFormat})`;

}

