});
it('return value if only start has value', () => {
    const start = new Date(2024, 3, 7);
    const output = '(start:(year:2024,month:4,day:7))';
    assert.deepEqual(dateRangeFormat('Europe/Prague', start, null), output);
});
it('return value if both start and end have value', () => {
