function convertArrayToFormat(array, isURN = false) {

    if(!array || !Array.isArray(array) || array.length === 0) return;

    return 'List(' + array.map(value => isURN ? value.replace(/:/g, '%3A') : `(value:${value})`).join(',') + ')';

}

